// SPDX-License-Identifier: MIT OR Apache-2.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./roles/MinterRole.sol";

import "./NFT721Creator.sol";
import "./NFT721Metadata.sol";

/**
 * @notice Allows creators to mint NFTs.
 */
abstract contract NFT721Mint is
  Initializable,
  ERC721Upgradeable,
  NFT721Creator,
  NFT721Metadata,
  MinterRole
{
  uint256 private nextTokenId;

  event Minted(
    address indexed creator,
    uint256 indexed tokenId,
    string indexed indexedTokenIPFSPath,
    string tokenIPFSPath
  );

  using Counters for Counters.Counter;

  Counters.Counter private _tokenIdTracker;

  function _baseURI() internal view virtual override(ERC721Upgradeable,NFT721Metadata) returns (string memory) {
    return GetBaseURI();
  }

  /**
   * @notice Gets the tokenId of the next NFT minted.
   */
  function getNextTokenId() public view returns (uint256) {
    return nextTokenId;
  }

  function tokenURI(uint256 tokenId) public view virtual override(ERC721Upgradeable, NFT721Metadata) returns (string memory) {
    return super.tokenURI(tokenId);
  }

  /**
   * @dev Called once after the initial deployment to set the initial tokenId.
   */
  function _initializeNFT721Mint() internal initializer {
    // Use ID 1 for the first NFT tokenId
    nextTokenId = 1;
  }

  /**
   * @notice Allows a creator to mint an NFT.
   */
  function mint(string memory tokenIPFSPath) public onlyMinter returns (uint256 tokenId) {
     _tokenIdTracker.increment();
    tokenId = nextTokenId++;

    _safeMint(msg.sender, tokenId);
    _updateTokenCreator(tokenId, payable(msg.sender));
    _setTokenIPFSPath(tokenId, tokenIPFSPath);
    emit Minted(msg.sender, tokenId, tokenIPFSPath, tokenIPFSPath);
  }

  function mint(string memory tokenIPFSPath, address to, uint256 tokenId) public onlyMinter virtual {
    // To ensure are not overlaping with the auto incremented ones
    require(tokenId > 9999999, "Mint: Custom TokenID must be higher than 10000000");
    require(!_exists(tokenId), "Mint: TokenId already existent");

     _tokenIdTracker.increment();
    _safeMint(to, tokenId);
    _updateTokenCreator(tokenId, payable(to));
    _setTokenIPFSPath(tokenId, tokenIPFSPath);
    emit Minted(to, tokenId, tokenIPFSPath, tokenIPFSPath);
  }

  function totalOfMintedTokens() public view returns(uint256) {
      return _tokenIdTracker.current();
    }

  /**
   * @dev Explicit override to address compile errors.
   */
  function _burn(uint256 tokenId) internal virtual override(ERC721Upgradeable, NFT721Creator, NFT721Metadata) {
    super._burn(tokenId);
  }

  function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721Upgradeable, NFT721Metadata, AccessControlUpgradeable, NFT721Creator) returns (bool) {
    return super.supportsInterface(interfaceId);
  }

  uint256[1000] private ______gap;
}
